(46, 'terms', '<p>Updating.............شركة تريبوتاكسي tripotaxi<br />\r\nالشروط والأحكام<br />\r\nآخر تحديث: 20 أبريل &nbsp;2021<br />\r\n1. العلاقة التعاقدية<br />\r\nتحكم شروط الاستخدام هذه (&quot;الشروط&quot;) وصول أو استخدام الأفراد من دولة ليبيا للتطبيقات والمواقع الإلكترونية والمحتويات والمنتجات والخدمات (&quot;الخدمات&quot;) التي توفرها شركة تريبوتاكسي ، وهي شركة خاصة ذات مسؤولية محدودة تأسست في ليبيا ويقع مقرها الرئيسي في طرابلس، ومسجلة لدى غرفة التجارة بليبيا تحت رقم: -<br />\r\n&nbsp;( تريبوتاكسي tripotaxi ).<br />\r\nيُرجى قراءة هذه الشروط بعناية قبل الحصول على الخدمات أو استخدامها.<br />\r\nإن وصولك إلى الخدمات واستخدامها يعتبر موافقة منك على الالتزام بهذه الشروط، مما يُنشئ علاقة تعاقدية بينك وبين تريبوتاكسي . وفي حالة عدم موافقتك على هذه الشروط، لا يجوز لك الحصول على الخدمات أو استخدامها. وتحل هذه الشروط تحديداً محل أي اتفاقات أو ترتيبات سابقة أبرمت معك. ويجوز لشركة تريبوتاكسي &nbsp;إنهاء هذه الشروط أو أي من الخدمات التي تخصك على الفور أو بشكل عام إيقاف عرض الخدمات أو منع الوصول إليها أو إلى أي جزء منها في أي وقت ولأي سبب كان.<br />\r\nوقد تنطبق بعض الشروط التكميلية على خدمات معينة، كالسياسات الخاصة بحدث أو نشاط أو حملة ترويجية معينة، وسيتم الإفصاح لك عن هذه الشروط التكميلية المتعلقة بالخدمات المقدمة. تُضاف الشروط التكميلية إلى الشروط لأغراض الخدمات المقدمة كما وتعتبر جزءاً منها. وتسود الشروط التكميلية على هذه الشروط في حالة التعارض فيما يتعلق بالخدمات المقدمة.<br />\r\nويجوز لشركة تريبوتاكسي &nbsp;تعديل الشروط المتعلقة بالخدمات من حين إلى آخر. وتسري التعديلات عند نشر تكسيستي هذه الشروط المحدثة على هذا الموقع أو نشر السياسات المعدلة أو الشروط التكميلية المتعلقة بالخدمة المقدمة. إن استمرار وصولك إلى الخدمات أو استخدامها بعد هذا النشر يعتبر موافقة منك على الالتزام بالشروط بصيغتها المعدلة.<br />\r\nنحن نقوم بجمع البيانات الشخصية واستخدامها فيما يتعلق بالخدمات وفقًا لما هو منصوص عليه في سياسة الخصوصية الخاصة بشركة تريبوتاكسي &nbsp;والتي يمكن الاطلاع عليها &nbsp;<br />\r\n. ويجوز لشركة تكسيستي تقديم ما يلزم من المعلومات (بما في ذلك معلومات الاتصال الخاصة بك) إلى شركات تسوية المطالبات أو شركات التأمين في حال وجود شكوى أو نزاع أو خلاف والذي قد يتضمن حادثاً يقع بينك وبين مقدم خدمات خارجي (بما في ذلك سائق شركة في شبكة النقل) حيث تكون هذه المعلومات أو البيانات ضرورية لتسوية الشكوى أو النزاع أو الخلاف.<br />\r\n2. الخدمات<br />\r\nتُشكل الخدمات منصة تقنية تمكّن مستخدمي تطبيقات الجوال أو المواقع الإلكترونية الخاصة بشركة تريبوتاكسي &nbsp;والمتاحة كجزء من الخدمات (يُشار إلى كل منها بـ &quot;التطبيق&quot;) لترتيب وجدولة خدمات النقل و/أو الخدمات اللوجستية مع الأطراف الخارجية المستقلة المقدمة لهذه الخدمات، بما في ذلك مقدمي خدمات النقل الخارجيين المستقلين ومقدمي الخدمات اللوجستية الخارجيين المستقلين بموجب الاتفاق مع تريبوتاكسي &nbsp;أو بعض شركاتها الفرعية (&quot;مقدمو الخدمات الخارجيون&quot;). يتم توفير الخدمات لاستخداماتك الشخصية غير التجارية فقط إلا إذا وافقت تريبوتاكسي &nbsp;على خلاف ذلك في اتفاقية كتابية منفصلة معك. وتقر من جانبك بأن تريبوتاكسي &nbsp;لا تقدم خدمات النقل أو الخدمات اللوجستية أو تعمل بوصفها شركة نقل وأن جميع خدمات النقل أو الخدمات اللوجستية تقدم بواسطة مقاولين خارجيين مستقلين لا يعملون لدى تربوتاكسي &nbsp;أو أي من شركاتها الفرعية.<br />\r\nالترخيص.<br />\r\nتمنحك شركة تريبوتاكسي ، شريطة امتثالك بهذه الشروط، ترخيصاً محدوداً غير حصري لا يمكن ترخيصه من الباطن ولا يمكن نقله إلى شخص آخر وهو قابل للإلغاء، من أجل: (1) الوصول إلى التطبيقات واستخدامها على جهازك الشخصي فيما يتعلق باستخدامك للخدمات فقط؛ و(2) الوصول إلى أي من المحتويات والمعلومات والمواد ذات الصلة التي قد يتم توفيرها من خلال الخدمات واستخدامها، وفي جميع هذه الحالات يكون الاستخدام شخصي فقط وغير التجاري. وتحتفظ شركة تريبوتاكسي &nbsp;والمرخصون التابعون لها بأي من الحقوق غير الممنوحة صراحة في هذه الشروط.<br />\r\nالقيود.<br />\r\nلا يحق لك إجراء ما يلي: (1) إزالة أيٍ من حقوق الطبع والنشر أو العلامات التجارية أو غيرها من إشعارات الملكية من أي جزء من الخدمات؛ أو (2) استنساخ الخدمات أو تعديلها أو إعداد أعمال مشتقة منها أو توزيعها أو ترخيصها أو تأجيرها أو بيعها أو إعادة بيعها أو نقل ملكيتها أو عرضها علانية أو أدائها علانية أو بثها أو تعميمها أو نشرها أو استغلالها بأي شكل آخر باستثناء ما تسمح به تريبوتاكسي &nbsp;صراحة؛ أو (3) التلاعب بشفراتها أو عكس هندستها أو تفكيكها باستثناء ما تسمح به القوانين المطبقة؛ أو (4) إنشاء ارتباط لأي جزء من الخدمات أو إعداد نسخ مطابقة منها أو تأطيرها؛ أو (5) إنشاء أو التسبب في إنشاء أي برامج أو برامج نصية بغرض التخلص من أي جزء من الخدمات أو فهرسته أو مسحه أو استغلال بياناته بطريقة أخرى، أو إثقال أو إعاقة عمل و/أو وظيفة أي جانب من الخدمات على نحو غير ملائم؛ أو (6) محاولة الدخول بشكل غير مصرح به للخدمات أو إتلاف أي من جوانبها أو أي من الأنظمة والشبكات المتعلقة بها.<br />\r\nتقديم الخدمات.<br />\r\nتقر بأنه يجوز إتاحة أجزاء من الخدمات تحت العلامات التجارية المختلفة لشركة تريبوتاكسي &nbsp;أو خيارات الطلب المرتبطة بخدمات النقل أو الخدمات اللوجستية، بما في ذلك أنواع خدمات النقل المشار إليها في الوقت الراهن وعلامات طلب الخدمات اللوجستية والتي يُشار إليها في الوقت الراهن. وتقر أيضاً بأنه يجوز توفير الخدمات بموجب هذه العلامات التجارية أو خيارات الطلب بواسطة أو فيما يتعلق بما يلي: (1) بعض الشركات الفرعية والتابعة لشركة تريبوتاكسي ؛ أو (2) مقدمو خدمات خارجيون مستقلون، بما في ذلك سائقو شركات شبكة النقل أو حاملو التصاريح بموجب ميثاق النقل أو حاملو التصاريح أو الأذون أو تراخيص النقل المماثلة.<br />\r\nخدمات ومحتوى الأطراف الخارجية.<br />\r\nقد يتم توفير الخدمات أو إتاحة الوصول إليها بالاقتران بخدمات ومحتوى أطراف خارجية (بما في ذلك الإعلان) والتي لا تخضع لسيطرة شركة تريبوتاكسي . وتقر بأنه قد تسري شروط استخدام وسياسات خصوصية مختلفة على استخدامك لخدمات ومحتوى الأطراف الخارجية. لا تُصادق تريبوتاكسي &nbsp;على خدمات ومحتوى الأطراف الخارجية ولا تتحمل بأي حال من الأحوال المسؤولية تجاه أي من منتجات أو خدمات مقدمي الخدمات الخارجيين. إضافة إلى ذلك، تعتبر شركة آبل أو شركة غوغل أو مايكروسوفت كوربوريشن أو بلاك بيري ليمتد و/أو شركاتهم التابعة والفرعية الدولية المعنية مستفيدين خارجيين لهذا العقد إذا قمت بالوصول إلى الخدمات باستخدام التطبيقات المصممة خصيصاً لأجهزة الجوال التي تعمل بنظام ابل اي او اس واندرويد على التوالي. ولا يعتبر هؤلاء المستفيدون الخارجيون أطرافًا في هذا العقد ولا يتحملون المسؤولية عن تقديم الخدمات أو دعمها بأي طريقة كانت. ويخضع وصولك إلى الخدمات باستخدام هذه الأجهزة إلى الشروط المنصوص عليها في شروط الخدمة المطبقة الخاصة بالمستفيد الخارجي.<br />\r\nالملكية.<br />\r\nتظل الخدمات وجميع الحقوق المتعلقة بها ملكية خاصة بشركة تريبوتاكسي &nbsp;أو بمانحي التراخيص التابعين لها. ولا تمنحك هذه الشروط ولا استخدامك للخدمات أي حقوق: (1) في الخدمات أو فيما يتعلق بها بخلاف الترخيص المحدود الممنوح أعلاه؛ أو (2) لاستخدام أو الإشارة بأي طريقة إلى أسماء الشركات أو الشعارات أو أسماء المنتجات والخدمات أو العلامات التجارية أو علامات الخدمة الخاصة بشركة تريبوتاكسي &nbsp;أو تلك الخاصة بالمرخصين التابعين لها.<br />\r\n3. استخدامك للخدمات<br />\r\nحسابات المستخدمين.<br />\r\nمن أجل استخدام معظم جوانب الخدمات، يجب أن تقوم بالتسجيل من أجل الحصول على حساب شخصي فعّال لخدمات المستخدم والمحافظة عليه (&quot;الحساب&quot;). ويجب أن يكون عمرك 18 عاماً على الأقل أو تكون في سن الرشد القانونية في ولايتك القضائية (إن كان مختلفاً عن 18 عاماً) حتى يتسنى لك الحصول على حساب. ويتطلب تسجيل الحساب تقديم معلومات شخصية معينة إلى تريبوتاكسي &nbsp;كاسمك وعنوانك ورقم هاتفك الجوال وعمرك، إضافة إلى طريقة دفع واحدة صحيحة على الأقل (إما بطاقة ائتمانية أو شريك دفع مقبول). وتوافق من جانبك على تدوين معلومات دقيقة وكاملة وحديثه في حسابك الخاص والمحافظة عليها. وقد يؤدي عدم محافظتك على وجود معلومات دقيقة وكاملة وحديثه في حسابك، بما في ذلك تعيين طريقة دفع غير صالحة أو منتهية الصلاحية، إلى عدم قدرتك على الوصول إلى الخدمات أو استخدامك لها أو إنهاء تريبوتاكسي &nbsp;لهذه الشروط معك. تتحمل أنت المسؤولية عن جميع الأنشطة التي تُجرى باسم حسابك، كما توافق على الحفاظ على أمان وسرية اسم المستخدم وكلمة المرور الخاصين بحسابك طوال الوقت. لا يحق لك امتلاك أكثر من حساب واحد ما لم تسمح لك تريبوتاكسي &nbsp;كتابةً بخلاف ذلك.<br />\r\nمتطلبات المستخدم وسلوكه.<br />\r\nلا تتوفر الخدمة للاستخدام من قبل الأشخاص دون سن 18 عاماً. ولا يحق لك تفويض استخدام حسابك لأطراف خارجية، كما لا يمكنك السماح للأشخاص دون 18 عاماً بالحصول على خدمات النقل والخدمات اللوجستية من مقدمي خدمات خارجيين ما لم يكونوا بصحبتك. ولا يجوز لك التنازل عن حسابك أو نقل ملكيته إلى أي شخص أو كيان آخر. وتوافق من جانبك على الامتثال لجميع القوانين المعمول بها عند استخدام الخدمات ولا يجوز لك استخدامها إلا لأغراض قانونية (على سبيل المثال، عدم نقل مواد غير قانونية أو خطرة). ولا يجوز لك أن تتسبب، عند استخدامك للخدمات، في إلحاق أذى أو إزعاج أو مضايقة أو أضرار في الملكية، سواء إلى مقدمي الخدمات الخارجيين أو إلى أي أطراف أخرى. وفي بعض الحالات، قد يُطلب منك تقديم إثبات شخصية للوصول إلى الخدمات أو استخدامها، وتوافق على أنه قد تُمنع من الوصول إلى الخدمات أو من استخدامها إذا ما رفضت تقديم إثبات الشخصية.<br />\r\nالرسائل النصية.<br />\r\nبمجرد إنشاء الحساب، فأنت توافق على أن الخدمات قد ترسل إليك بعض الرسائل النصية المعلوماتية كجزء من سياق الأعمال الطبيعي لاستخدامك للخدمات. ويحق لك رفض تلقي الرسائل النصية من تريبوتاكسي &nbsp;في أي وقت وذلك عن طريق إرسال رسالة إلى بريدنا الإلكتروني توضح فيها عدم رغبتك في تلقي مزيد من هذه الرسائل مع تضمين رقم الجوال الذي يتلقى هذه الرسائل. وتقر من جانبك بأن رفض تلقي الرسائل النصية قد يؤثر على استخدامك للخدمات.<br />\r\nالرموز الترويجية.<br />\r\nيجوز لشركة تريبوتاكسي ، وفق تقديرها المطلق، إنشاء رموز ترويجية يجوز استردادها وإضافتها إلى الحساب أو مزايا أو منافع أخرى تتعلق بالخدمات و/أو خدمات مقدمي الخدمات الخارجيين، وذلك رهناً بأي شروط إضافية تضعها تريبوتاكسي &nbsp;على أساس كل رمز ترويجي (&quot;الرموز الترويجية&quot;). توافق من جانبك على أن الرموز الترويجية: (1) يجب استخدامها للجمهور والغرض المستهدف وبطريقة قانونية؛ و(2) لا يجوز نسخها أو بيعها أو نقل ملكيتها بأي طريقة كانت أو إتاحتها للعامة (سواء نُشرت على نموذج عام أم غير ذلك)، ما لم تسمح بذلك تريبوتاكسي &nbsp;صراحة؛ و(3) يجوز تعطيلها من قبل تريبوتاكسي &nbsp;في أي وقت ولأي سبب دون أن تتحمل أي مسؤولية قانونية؛ و(4) لا يمكن استخدامها إلا وفقاً للشروط الخاصة التي وضعتها تريبوتاكسي &nbsp;لكل رمز ترويجي؛ و(5) لا تصلح للدفع النقدي؛ و(6) يمكن أن تنتهي قبل استخدامك لها. وتحتفظ تريبوتاكسي &nbsp;بحقها في سحب أو اقتطاع الأرصدة المضافة أو المزايا أو المنافع الأخرى والتي تم الحصول عليها من خلال استخدام الرموز الترويجية بواسطتك أو بواسطة أي مستخدم آخر وذلك في حالة ما إذا حددت تريبوتاكسي &nbsp;أو اعتقدت أن استخدام أو استرداد الرموز الترويجية كان خطئاً أو احتيالاً أو غير قانوني أو كان ينتهك الشروط الخاصة بالرموز الترويجية المعمول بها أو هذه الشروط.<br />\r\nالمحتوى المقدم من المستخدم.<br />\r\nيحق لشركة تريبوتاكسي ، وفق تقديرها المطلق، السماح لك بين الفينة والأخرى بتقديم أو تحميل أو نشر أو توفير بطريقة أخرى محتوى ومعلومات نصية و/أو سمعية و/أو بصرية إلى تريبوتاكسي &nbsp;من خلال الخدمات، بما في ذلك التعليقات والتعقيبات المتعلقة بالخدمات، وإنشاء طلبات الدعم، وتقديم المدخلات للمنافسات والعروض الترويجية (&quot;محتوى المستخدم&quot;). أي محتوى مُنشأ بواسطة المستخدم تقدمه أنت يبقى ملكية خاصة بك. ومع ذلك، فبمجرد تقديم المحتوى المنشأ بواسطة المستخدم إلى شركة تريبوتاكسي ، فإنك تمنحها رخصة عالمية ودائمة وغير قابلة للإلغاء ولا يمكن نقل ملكيتها وخالية من الامتيازات، إلى جانب الحق في ترخيص محتوى المستخدم من الباطن، واستخدامه ونسخه وتعديله وإقامة أعمال مشتقة منه وتوزيعه وعرضه علانية وأدائه علانية واستغلاله بأي طريقة أخرى في جميع الأشكال وقنوات التوزيع المعروفة حالياً أو التي تُبتكر فيما بعد (بما في ذلك ما يتعلق بالخدمات والأعمال الخاصة بشركة تريبوتاكسي &nbsp;وكذلك المواقع والخدمات الخاصة بأطراف خارجية)، وذلك دون إرسال إخطارات إضافية لك أو الحصول على موافقة من جانبك ودون الحاجة إلى الدفع لك أو إلى أي شخص أو كيان آخر.<br />\r\nتتعهد من جانبك وتضمن ما يلي: (1) أنك إما المالك الحصري والوحيد لجميع محتوى المستخدم أو أنك تتمتع بجميع الحقوق وتمتلك جميع التراخيص والموافقات والإعفاءات الضرورية لمنح ترخيص إلى تريبوتاكسي &nbsp;باستخدام محتوى المستخدم على النحو المنصوص عليه أعلاه؛ و(2) ألا يتسبب محتوى المستخدم ولا تقديمك أو تحميلك أو نشرك لهذا المحتوى أو توفيره بأي شكل آخر ولا استخدام تريبوتاكسي &nbsp;لمحتوى المستخدم في انتهاك أو اختلاس أو مخالفة أي من حقوق الملكية الفكرية أو الحقوق الخاصة أو حقوق الطبع والنشر أو الخصوصية لطرف خارجي وألا يؤدي إلى الإخلال بأي من القوانين أو اللوائح المعمول</p>\r\n'),
